import React from 'react'
import {IoClose} from 'react-icons/'
import {DropDown} from './style';


const DropDownMenu = () => {
    return (
        <DropDown>
            <DropUp>
                <Logo/>
                <IoClose/>
            </DropUp>
        </DropDown>
    )
}

export default DropDownMenu
